style.css:
@-moz-document domain("youtube.com") {
ytd-thumbnail[size=large] a.ytd-thumbnail, ytd-thumbnail[size=large]:before {
    border-radius: 0px 
}

ytd-thumbnail[size=medium] a.ytd-thumbnail, ytd-thumbnail[size=medium]:before {
    border-radius: 0px !important;
}

.ytp-ce-video.ytp-ce-large-round, .ytp-ce-playlist.ytp-ce-large-round {
    border-radius: 0px !important;
}

.ytp-videowall-still-round-medium .ytp-videowall-still-image {
    border-radius: 0px !important;
}

.ytp-videowall-still-round-large .ytp-videowall-still-image {
    border-radius: 0px !important;
}


ytd-video-renderer[use-bigger-thumbs][bigger-thumbs-style=BIG] ytd-thumbnail.ytd-video-renderer {
     max-width: 360px !important; 
    min-width: 240px;
}

ytd-channel-renderer[use-bigger-thumbs][bigger-thumb-style=BIG] #avatar-section.ytd-channel-renderer {
     max-width: 360px !important; 
    min-width: 240px;
}

ytd-radio-renderer[use-bigger-thumbs][bigger-thumbs-style=BIG] ytd-playlist-thumbnail {
    max-width: 360px !important;
    min-width: 240px;
}

ytd-player{
    display: contents !important;
    width: 100%;
    height: 100%;
}
}
